import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    Container,
    IconButton,
    Box,
    ImageList,
    ImageListItemBar,
    ImageListItem,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
  } from "@mui/material";
  import image1 from './images/image1.png';
  import image2 from './images/image2.png';
  import image3 from './images/test.png';
  import image4 from './images/image4.png';
  import image5 from './images/image5.png';

  import video1 from './videos/video1.gif';
  import video2 from './videos/video2.gif';
  import video3 from './videos/video3.gif';

  const itemData = [
    {
      img: image1,
      title: 'Breakfast',
    },
    {
      img: image2,
      title: 'Burger',
    },
    {
      img: image3,
      title: 'Camera',
    }, 
    {
      img: image4,
      title: 'Mushrooms',
    },
    {
      img: image5,
      title: 'Tomato basil',
    }];

  const videoData = [
    {
      img: video1,
      title: 'video1',
    },{
      img: video2,
      title: 'video1',
    },
    {
      img: video3,
      title: 'video3',
    }
  ];

  function Projects() {
    return (
      <Container
      fixed
      sx={{
        bgcolor: "transparent",
        marginTop: '10vh', 
        marginBottom: '10vh',
      }}
    >
      <Box sx={{ pt: "10px" }}>
        <h1>Maze Game</h1>
        <Box sx={{ mb: "10px", borderBottom: "2px solid white" }}>
          <Typography>Screenshots</Typography>
          <Stack spacing={0} direction="row" sx={{ overflowX: "auto" }}>
            <ImageList
                    sx={{
                      width: "100vw", // Set a fixed width to determine the visible images
                      display: "flex",
                      flexDirection: "row",
                    }}
                    rowHeight={500}
                  >
                    {itemData.slice(0, 10).map((item) => (
                      <ImageListItem
                        key={item.img}
                        sx={{
                          flex: "0 0 auto", // Allow the item to shrink but not grow
                          maxWidth: "40%", // Set the maximum width of each item
                          overflowY: "hidden",
                          margin: "0", // Add some spacing between items
                          height: "100vh",
                          "&:hover": {
                            border: "1px solid indigo",
                          },
                        }}
                      >
                        <img
                          src={`${item.img}?w=164&h=164&fit=crop&auto=format`}
                          srcSet={`${item.img}?w=164&h=164&fit=crop&auto=format&dpr=2 2x`}
                          alt={item.title}
                          loading="lazy"
                          style={{ objectFit: "cover", width: "100%", height: "100%" }}
                        />
                </ImageListItem>
                  ))}
              </ImageList>
          </Stack>
          <Typography>Gifs</Typography>
          <Stack spacing={0} direction="row" sx={{ overflowX: "auto" }}>
            <ImageList
                    sx={{
                      width: "100vw", // Set a fixed width to determine the visible images
                      display: "flex",
                      flexDirection: "row",
                    }}
                    rowHeight={500}
                  >
                    {videoData.slice(0, 10).map((video) => (
                      <ImageListItem
                        key={video.img}
                        sx={{
                          flex: "0 0 auto", // Allow the item to shrink but not grow
                          maxWidth: "30%", // Set the maximum width of each item
                          overflowY: "hidden",
                          margin: "0", // Add some spacing between items
                          height: "100vh",
                          "&:hover": {
                            border: "1px solid indigo",
                          },
                        }}
                      >
                        <img
                          src={`${video.img}?w=164&h=164&fit=crop&auto=format`}
                          srcSet={`${video.img}?w=164&h=164&fit=crop&auto=format&dpr=2 2x`}
                          alt={video.title}
                          loading="lazy"
                        />
                </ImageListItem>
                  ))}
              </ImageList>
          </Stack>
        </Box>
        <Typography variant="h6">Introduction:</Typography>
      </Box>
    </Container>
    );
  };

  export default Projects;
